   it may lose all or a substantial portion of its principal due to devaluation of the currency other than the
    Specified Currency.

Any reference in these Terms and Conditions to principal in respect of the Notes shall be deemed to
include, as applicable:

(i)   any additional amounts which may be payable with respect to principal under Condition 7;

(ii) the Final Redemption Amount of the Notes;

(iii) the Early Redemption Amount of the Notes;

(iv) the Optional Redemption Amount(s) (if any) of the Notes;

(v) in relation to Instalment Notes, the Instalment Amounts;

(vi) in relation to Zero Coupon Notes, the Amortised Face Amount; and

(vii) any premium and any other amounts which may be payable by the Issuer under or in respect of the
      Notes.

"Amortised Face Amount" has the meaning specified in Condition 5(e)(iii);

"Instalment Amount(s)" means the amount(s) specified as such in the applicable Final Term; and

"Optional Redemption Amount(s)" means an amount specified as such in the applicable Final Terms,

